    "#Loading all packages and datasets we'll need for this homework\n",
    "library(tidyverse) # metapackage of all tidyverse packages\n",
    "library(glmnet)\n",
    "library(ggplot2)\n",
    "library(caret)\n",
    "  \n",
    "\n",
    "uscrime <- read.table(\"../input/week-5-try-2/week 5 data-summer/data 11.1/uscrime.txt\", header = TRUE, sep = \"\", check.names=FALSE)\n",
    "crime_scaled <- as.data.frame(scale(uscrime))"
   ]
