   "source": [
    "Use the step() function from the stats package to perform stepwise selection, which uses the following syntax: 1. intercept-only model (formula for model), 2. direction (both, backward, or forward), and 3. scope (formula that specifies which predictors we'd like to attempt to entire into the model). There is an additional argument trace which tells R to either display the full results of the stepwise selection (trace = 1) or not (trace =0). This is an optional feature because a large number of predictor variables will take up a lot of space."
   ]
