   "source": [
    "This model works in the opposite direction of forward regression by beginning with all the predictors and then fitting the model with all predictors less one from which it chooses the best option. This step is then repeated (models created containing all leftover predictors less one) and the best model chosen until we have a single best model using AIC. Thus the above shows the following:\n",
    "\n",
    "First, we fit the model with all predictors and the result is a model with an AIC of 514.6488.\n",
    "\n",
    "Next, we fit every possible predictor model less one, and the model that produces the lowest AIC and also had a statistically significant reduction in AIC compared to the model containing all the predictor variables drops the So predictor for an AIC of 512.6498.\n",
    "\n",
    "This is then repeated until Time, LF, NW, Po2, PoP, and Wealther are removed, and we stop the backward regression procedure as we've found that removing any further variables does not produce a significant reduction in AIC.\n",
    "\n",
    "Thus the final model is Crime ~ -6426.1010176047 + M*93.321548929002 + Ed*180.120112724867 + Po* 1102.653158730656 + M.F* 22.3397462854023 - U1*6086.63315310635 + U2*187.345117379629 + Ineq*61.3349422179913 - Prob*3796.03182610118.\n"
   ]
