    "\n",
    "#perform backward stepwise regression\n",
    "both_rgr <- step(intercept_only, direction='both', scope=formula(all), trace=0)\n",
    "\n",
    "#view results of backward stepwise regression\n",
    "both_rgr$anova\n",
