   "source": [
    "This model begins by first fitting only the intercept-only model before then proceeding to add predictors to the model sequentially just like we did in forward-stepwise selection. However, after adding each predictor, we also remove any predictors that no longer provided an improvement in model fit. This process is then repeated over and over until we reach a final model which is the below:\n",
    "\n",
    "Crime ~ -5040.50497740907 + Po*1115.024190750001 + Ineq*67.6532158858335 + Ed*196.471200528952 + M*105.019567900143 - Prob*3801.83627942789 + U2*89.36604308695\n",
    "\n",
    "In this particular case, the both the forward and both-direction stepwise regression produced the same final model (backward produced a different model). Thus, we can feel confident in using this model as it has the lowest AIC in both cases."
   ]
