   "source": [
    "#2 Lasso Regression\n",
    "set.seed(3)\n",
    "\n",
    "#define response variable\n",
    "y <- crime_scaled$Crime\n",
    "\n",
    "#define matrix of predictor variables\n",
    "x <- data.matrix(crime_scaled[, -which(names(crime_scaled) == \"Crime\")])\n",
    "\n",
    "#Use the glmnet() function to fit the lasso regression model with alpha=1 as setting alpha = 0 is analogous to using ridge regression and alpha = (0-1) is using elastic net. We'll use cv.glmnet() to perform k-fold cross validation to help determine which lambda produces the lowest MSE (mean squared error) which is the lambda we will use in our model. The default is k = 10 folds.\n",
    "\n",
    "#k-fold cross-validation to find best lambda value\n",
    "kfold_model <- cv.glmnet(x, y, alpha = 1)\n",
    "\n",
    "#find best lambda value with minimal test MSE\n",
    "best_lambda <- kfold_model$lambda.min\n",
    "cat(\"The best lambda value to use is:\", best_lambda)\n",
    "\n",
    "#produce plot of MSE by lambda value\n",
    "plot(kfold_model)"
   ]
  },
