   "source": [
    "set.seed(20)\n",
    "#k-fold cross-validation to find best lambda value\n",
    "kfold_model2 <- cv.glmnet(x, y, alpha = 1, nfolds = 3)\n",
    "\n",
    "#find best lambda value with minimal test MSE\n",
    "best_lambda2 <- kfold_model2$lambda.min\n",
    "cat(\"The best lambda value to use is:\", best_lambda2)\n",
    "\n",
    "#produce plot of MSE by lambda value\n",
    "plot(kfold_model2)"
   ]
