   "source": [
    "#3 Elastic Net Regression\n",
    "set.seed(7)\n",
    "\n",
    "#define response variable\n",
    "Crime <- crime_scaled$Crime\n",
    "\n",
    "#define matrix of predictor variables\n",
    "y <- data.matrix(crime_scaled[, -which(names(crime_scaled) == \"Crime\")])\n",
    "\n",
    "r_squared=c()\n",
    "for (i in 0:10) {\n",
    "  elastic_net <- cv.glmnet(y, Crime, alpha=i/10, nfolds = 10, type.measure=\"mse\", family=\"gaussian\")\n",
    "  #dev.ratio is the percentage of deviance explained. min index for the dev.ratio of the model\n",
    "  r_squared = cbind(r_squared, elastic_net$glmnet.fit$dev.ratio[which(elastic_net$glmnet.fit$lambda == elastic_net$lambda.min)])\n",
    "}\n",
    "\n",
    "r_squared\n",
    "\n",
    "#get the best alpha\n",
    "alpha <- (which.max(r_squared)-1)/10\n",
    "cat(\"Best alpha value is:\", alpha)\n",
    "\n",
    "#get model with best alpha\n",
    "uscrime_elastic <- cv.glmnet(y, Crime, alpha=alpha, nfolds = 10, type.measure=\"mse\", family=\"gaussian\")\n",
    "\n",
    "plot(uscrime_elastic)\n",
    "coef(uscrime_elastic)"
   ]
  },
