    "#Elastic Net Method 2\n",
    "set.seed(15)\n",
    "\n",
    "#define response variable\n",
    "Crime <- crime_scaled$Crime\n",
    "\n",
    "#define matrix of predictor variables\n",
    "y <- data.matrix(crime_scaled[, -which(names(crime_scaled) == \"Crime\")])\n",
    "\n",
    "#create custom Control Parameters for model\n",
    "control <- trainControl(method = \"repeatedcv\", number = 5, repeats = 5, search = \"random\", verboseIter = TRUE)\n",
    " \n",
    "# Training Elastic Net Regression model\n",
    "elastic_model <- train(Crime ~ ., data = cbind(Crime, y),method = \"glmnet\",preProcess = c(\"center\", \"scale\"),tuneLength = 25,trControl = control)"
   ]
