    "## Question 12.1\n",
    "Describe a situation or problem from your job, everyday life, current events, etc., for which a design of experiments approach would be appropriate."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "df25f00e",
   "metadata": {
    "papermill": {
     "duration": 0.018228,
     "end_time": "2022-07-08T14:03:44.356438",
     "exception": false,
     "start_time": "2022-07-08T14:03:44.338210",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "The Design of experiments (DOE) is a systematic method allows us to study the relationship between multiple input variables (aka factors) and key output variables (aka responses). It’s very helpful in determining whether a factor (or collection) influences the response, whether the factors interact in their effect on the response, modeling the behavior of the response as a function of the factors, and optimizing the response. I work in the supply chain industry, and we’re currently looking to improve our productivity in terms of cases selected per hour (product picked to send to retail) which is perfect for the design of experiments approach, particularly the factorial design. Several factors influence this metric including headcount (number of people employed, third party vs internal labor), warehouse capacity (too little/enough/too much product), type of hours (regular, overtime), day of the week (more call offs on weekends), time of year (holidays, weather), etc. We’re currently working to build a model using these variables to reach the target case selection that our business has set, but the influence of these factors on the response and on each other is not well known (other than what we can obviously tell which is fewer employees = fewer cases, too much inventory = crowding and difficulty selecting product, time of year = holidays which means more employees and more cases picked, etc.)"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "01b5329a",
   "metadata": {
    "papermill": {
     "duration": 0.017239,
     "end_time": "2022-07-08T14:03:44.390819",
