    "tags": []
   },
   "source": [
    "## Question 13.1\n",
    "For each of the following distributions, give an example of data that you would expect to follow this distribution (besides the examples already discussed in class).\n",
    "\n",
    "a. Binomial\n",
    "\n",
    "b. Geometric\n",
    "\n",
    "c. Poisson\n",
    "\n",
    "d. Exponential\n",
    "\n",
    "e. Weibull"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "8859ceca",
   "metadata": {
    "papermill": {
     "duration": 0.017283,
     "end_time": "2022-07-08T14:03:44.425032",
     "exception": false,
     "start_time": "2022-07-08T14:03:44.407749",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "a. The binomial distribution shows the probability of success or failure outcome in an experiment or survey (repeated multiple times) and as clued by the name binomial only has two possible outcomes.  Some real world data that would follow this type of distribution include people suffering from disease such as covid-19 (you either have it or you don’t!), voters for a candidate (you either voted for the candidate or you didn’t!), students passing an exam, and number of spam emails per day.\n",
    "\n",
    "b. The geometric distribution represents the number of failures one gets before a success in a series of Bernoulli trials (the number of tries between failures). Examples of data that would follow a distribution of this type include polling data (how many people we have to poll before we’d find an independent), customer feedback, number of faulty products manufactured at an industry, and throwing darts at a dartboard (on top of a large number of other sports applications).\n",
    "\n",
    "c. The Poisson distribution helps predict the probability of a certain event happening when you know how often the event has occurred in the past. There many examples of data that would follow a Poisson distribution but some include the number of losses/claims occurring in a given time period, movements in a stock price, number of mutations in a strand of DNA per unit length, visitors to a website, and many other count data \n",
    "\n",
    "d. The exponential distribution is the probability distribution of the time between events. Furthermore I the number of events in a fixed time follows the Poisson distribution, then the time between them has the exponential distribution. Some examples of data that would follow this distribution include monthly and annual maximum values of daily rainfall and river discharge volumes, the time it takes before someone receives their next telephone call, and surgery distribution for a category of surgeries (operating-rooms management for scheduling purposes!)\n",
    "\n",
    "e. The Weibull distribution is used to model life data analysis (time until device failure) which is invaluable in assessing product reliability and model failure times. Thus, the data that I would expect to follow this type of distribution would include time failure for systems and parts for warranty analysis to assess when threshold to end warranties should be set), mortality rates in biology experiments, manufacturing and delivery times in industrial engineering, wind speed distributions in weather forecasting and the wind power distribution.\n"
   ]
  }
